import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = function() {
  return ( 
    <div className="App"> 

      <header className="header">
        <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2F2krota.ru%2Fwp-content%2Fuploads%2F2019%2F02%2F0_i-1.jpg&imgrefurl=https%3A%2F%2F2krota.ru%2Fpictures%2Fkartinki-volka-na-avu-65-foto.html&docid=uoaXz9V9IE3ZeM&tbnid=x6LGV3rCzbm3jM%3A&vet=10ahUKEwjSm9zagcLkAhXPR5oKHXHsDZ8QMwhWKAowCg..i&w=847&h=1280&client=firefox-b-d&bih=753&biw=1440&q=%D0%BA%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%BA%D0%B8&ved=0ahUKEwjSm9zagcLkAhXPR5oKHXHsDZ8QMwhWKAowCg&iact=mrc&uact=8"/>
        Header
      </header>

      <nav className="nav">
        <a>Profile</a>
        <a>Messages</a>
        <a>Music</a>
        <a>Settings</a>
        HiperNav
      </nav>

      <main className="main">
        Main content
      </main>

    </div> 
  );
}

export default App;
